export class CrankPushParams {
    crankAddr;
    aggregatorAddr;
    constructor(fields) {
        this.crankAddr = fields.crankAddr;
        this.aggregatorAddr = fields.aggregatorAddr;
    }
    toJSON() {
        return {
            crankAddr: this.crankAddr.toString(),
            aggregatorAddr: this.aggregatorAddr.toString(),
        };
    }
    static fromJSON(obj) {
        return new CrankPushParams({
            crankAddr: obj.crankAddr,
            aggregatorAddr: obj.aggregatorAddr,
        });
    }
    toMoveStruct() {
        return {
            crank_addr: this.crankAddr.toString(),
            aggregator_addr: this.aggregatorAddr.toString(),
        };
    }
    static fromMoveStruct(obj) {
        return new CrankPushParams({
            crankAddr: obj.crank_addr,
            aggregatorAddr: obj.aggregator_addr,
        });
    }
}
